                    result.append(nums1[i])
                    i += 1
                else:
                    result.append(nums2[j])
                    j += 1
            while i < len(nums1):
                result.append(nums1[i])
                i += 1
            while j < len(nums2):
                result.append(nums2[j])
                j += 1
            return result

        def merge_k_lists(nums1, nums2, k):
            # Merge the k lists and return the merged list
            if k == 0:
                return []
            if k == 1:
                return nums1 + nums2
            if k == 2:
                return merge(nums1, nums2)
            mid = k // 2
            nums1_left = merge_k_lists(nums1[:mid], nums2[:mid], mid)
            nums2_left = merge_k_lists(nums1[mid:], nums2[mid:], k - mid)
            return merge(nums1_left, nums2_left)

