class Solution(object):
    def partition(self, s):
        """
        :type s: str
        :rtype: List[List[str]]
        """

        def isPalindrome(s):
            return s == s[::-1]

        def backtrack(s, start, path, res):
            if start == len(s):
                res.append(path[:])
                return
            for i in range(start, len(s)):
                if isPalindrome(s[start:i+1]):
                    path.append(s[start:i+1])
                    backtrack(s, i+1, path, res)
                    path.pop()

        res = []
        backtrack(s, 0, [], res)
        return res

